import React, { Component } from "react";
import SearchBar from "./SearchBar";

export class App extends Component {
  render() {
    return (
      <div className="ui container">
        <SearchBar onSearchSubmit={this.handleSearchSubmit} />
      </div>
    );
  }
}

export default App;
